import React, { Component } from 'react'
import { Route, Redirect } from 'react-router'
const PrivateRoute = ({ component: Component, ...rest }) => (
    <Route {...rest} render={(props) => (
      props.logged
        ? <Component {...props} />
        : <Redirect to={{
          pathname: '/login',
          state: {from: props.location}
        }} />
    )} />
  )
export default PrivateRoute
